import React, { useState } from 'react';
import StaticElementsContainer from './containers/StaticElementsContainer';

function App() {
  const [loggedIn, setLoggedIn] = useState(false);

  return (
    <div className="App">
      <StaticElementsContainer>
        <div id="log-in-container">
          <h2>Username</h2>
          <h2>Password</h2>
          <h2>LOGIN</h2>
          <p>Forgot Username?</p>
          <p>Forgot Password?</p>
          <p>Create account</p>
        </div>
      </StaticElementsContainer>
    </div>
  );
}

export default App;
